o','Video','Great West Great Teachers','',49,'40903090','company',0),(9,1357586430,1357591947,1,'video','Video','Avaya Siperia','',50,'39372430','corporate',0),(10,1357586497,1357591981,1,'video','Video','JM Project Guide DIY','',51,'36316611','corporate',0),(11,1357586599,1357592007,1,'video','Video','Hunter Douglas - Motorized','',52,'33191663','company',0),(12,1357591301,1357592027,1,'video','Video','Hunter Douglas - Easy Adjust','',53,'33190450','corporate',0),(14,1357592776,0,1,'video','Video','Honest Bros','',56,'29106722','corporate',0),(15,1357592848,0,1,'video','Video','Level 3 PSN','',57,'39486377','corporate',0),(16,1357592922,0,1,'video','Video','Magnum Live Large Voting','',58,'24191598','company',0);
