INSERT INTO `taxi_home_page` VALUES (1,1356653115,1420487411,1,'home_page','Home Page','<h3>The Place</h3>\r\n\r\n<p>Home to a number of full time residents and over 80 creative businesses,TAXI is a mixed-use community rife with inspiration. Our campus, which is still expanding, is made up of six buildings and amenities, including a fitness center, cafe, coffee shop, salon, early childhood education center, outdoor cinema, one-of-a kind pool and community garden, which are designed to keep our community connected.<br>\r\n</p>\r\n<h3>The Location</h3>\r\n\r\n<p>Our gritty, urban location may seem off the beaten path, but what was once the heart of Denver\'s industry has transformed a former industrial site into the heart of Denver\'s vibrant RiNo Art District and is burgeoning with growth. Our location is strategically placed in between Denver\'s major thoroughfares and the Platte River, connecting us to downtown and surrounding areas.&nbsp;<br>\r\n</p>\r\n<h3>The Vision</h3>\r\n\r\n<p>TAXI was the brainchild of Mickey Zeppelin and his son Kyle, who saw a need to create a community that fostered the use of creative spaces for the new workforce. The campus has become a catalyst for collaboration and communication amongst businesses, residences and the community, making it more than a place to live or work, but something that is truly unique.&nbsp;<br>\r\n</p>\r\n',37,'3455 Ringsby Ct.<div>Unit 102<br><p>Denver, CO 80216<br></p><p>303.573.0781</p><p><br></p><p></p>\r\n</div>','Commercial Leasing<br>\r\n\r\n<p>kzeppelin@zeppelinplaces.com</p><p>Residential Leasing</p><p><span style=\"font-size: 15px; line-height: 1.45em;\">jamey@zeppelinplaces.com</span></p><p><span style=\"font-size: 15px; line-height: 1.45em;\">Event Information</span></p><p>marielle@zeppelinplaces.com<span style=\"font-size: 15px; line-height: 1.45em;\"><br></span></p>\r\n');
/*!40000 ALTER TABLE `taxi_home_page` ENABLE KEYS */;
UNLOCK TABLES;

